.library {
  background-color: #121212;
  border-radius: 8px;
  display: flex;
  justify-content: space-between;
  min-block-size: 40px;
  padding: 4px 8px;
  color: #b3b3b3;
  font-weight: 600;
  font-size: 14px;
  margin-top: 10px;
  flex-direction: column;
}

.library .library__button {
  margin-right: 10px;
  color: #b3b3b3;
  background-color: transparent;
  border: 0px;
  font-size: 1rem;
  font-weight: 700;
  font-family: 'Montserrat', sans-serif;
  text-align: center;
  text-decoration: none;
  text-transform: none;
  padding: 20px 10px;
  display: flex;
}

.library .library__button .fa {
  font-size: 20px;
  margin-right: 10px;
  font-weight: 300;
  padding-right: 8px;
}

.library__content {
  display: flex;
  justify-content: space-between;
}

.library .library__content .fa-plus {
  margin: 24px 10px;
}

.section-playlist {
  background-color: #242424;
  align-items: flex-start;
  border-radius: 8px;
  gap: 20px;
  display: flex;
  justify-content: space-between;
  min-block-size: 40px;
  color: #b3b3b3;
  font-weight: 600;
  font-size: 14px;
  margin: 8px 0;
  padding: 16px 20px;
}

.section-playlist .section-playlist__content {
  display: flex;
  flex-direction: column;
}

.section-playlist__content .text {
  padding-bottom: 14px;
  color: #fff;
}

.section-playlist__content .title {
  font-weight: 700;
}

.section-playlist__content .subtitle {
  font-weight: 500;
  font-size: 0.8rem;
}

.section-playlist__content .section-playlist__button {
  background-color: #ffffff;
  color: #000;
  border-radius: 9999px;
  display: flex;
  font-size: 0.8rem;
  font-weight: 700;
  font-family: 'Montserrat', sans-serif;
  text-decoration: none;
  text-transform: none;
  padding: 10px;
  border: 0px;
  width: 113px;
  justify-content: center;
  margin-top: 12px;
}

.sidebar .cookies {
  margin: 25px 20px;
}

.sidebar .cookies a {
  color: #b3b3b3;
  font-weight: 500;
  text-decoration: none;
  font-size: 10px;
}

.sidebar .cookies a:hover {
  text-decoration: underline;
}

.languages .languages__button {
  background-color: transparent;
  border-radius: 9999px;
  border: 1px solid #878787;
  color: #fff;
  cursor: pointer;
  align-items: center;
  padding: 8px;
  width: 170px;
  margin: 8px;
  font-weight: bold;
}
